function capitalize(str){
  if (str==""){
    return ""
  }
  var newstr = str.charAt(0).toUpperCase()

  for (var x = 1;x<str.length;x+=1){
    if (str.charAt(x-1)==" "){
      newstr = newstr+str.charAt(x).toUpperCase()
    }
    else{
      newstr = newstr+str.charAt(x); 
    }
  }
  return newstr
}

function formatcolor(){
  var col = document.getElementById('RGBinput').value.replace("(","").replace(")","")
  var col2=col.split(",")
  if (col2.length!=3){
    return -1
  }
  var col3=0
  for (var x = 0; x<col2.length;x++){
  	if (col2[x]>255 || col2[x]<0){
  		return(-1)
  	}
  	else{
    col3+=parseInt(col2[x])*(256**x)
	}
  }
  if (col3.toString()!="NaN"){
  return(col3)
  }
  else{
  	return -1
  }

 }

