function splitownerstr(str){
  while (str.length<256){
    str="0"+str
  }
  var out = []
  for (var x = 0; x < str.length; x+=8)
  {
    var c = str.slice(str.length-8-x,str.length-x)
    out[Math.floor(x/8)]=parseInt(c,2)
  }
  return(out)
}


